        public Prestacion getPrestacion(){
            return new PrestacionDao(ActiveDatabase.getDSLContext().configuration()).fetchOneByIdPrestacion(getIdPrestacion());
        }
        
    @OneToOne
        public Tecnico getTecnico(){
            return new TecnicoDao(ActiveDatabase.getDSLContext().configuration()).fetchOneByIdTecnico(getIdTecnico());
        }    
